import React, { Component } from 'react'
import "./Cars.css"


export default class Cars extends Component {

    state = {
        Cars: {
            uzb: {
                GM: [
                    {
                        name: "Matiz",
                        price: 3000 + '$',
                    },

                    {
                        name: "Spark",
                        price: 7000 + '$',
                    },

                    {
                        name: "Cobalt",
                        price: 10000 + '$',
                    }
                ],
                UzAutoMotars: [
                    {
                        name: "Lacetti",
                        price: 12000 + '$',
                    },

                    {
                        name: "Gentra",
                        price: 13000 + '$',
                    },

                    {
                        name: "Captiva",
                        price: 20000 + '$',
                    },
                ],
            },
            germaniya: {
                BMW: [
                    {
                        name: "BMW 528",
                        price: 46000 + '$',
                    },

                    {
                        name: "BMW 745",
                        price: 19000 + '$',
                    },

                    {
                        name: "BMW X6",
                        price: 32000 + '$',
                    },

                ],

                MercedesBenz: [
                    {
                        name: "Mercedes-Benz ML 350",
                        price: 30000 + '$',
                    },
                    {
                        name: "Mercedes-Benz S 550",
                        price: 34000 + '$',
                    },
                    {
                        name: "Mercedes-Benz C 180",
                        price: 5000 + '$',
                    },

                ],
            },
            xitoy: {
                Haval: [
                    {
                        name: "HAVAL JOLION",
                        price: 10000 + '$',
                    },

                    {
                        name: "HAVAL F7",
                        price: 14000 + '$',
                    },

                    {
                        name: "HAVAL H9",
                        price: 29000 + '$',
                    },

                ],

                Lifan: [
                    {
                        name: "LIFAN Breez",
                        price: 6000 + '$',
                    },
                    {
                        name: "LIFAN Cebrium",
                        price: 8000 + '$',
                    },
                    {
                        name: "LIFAN Celliya",
                        price: 10000 + '$',
                    },
                ],
            },
        }
    }




    render() {
        return (
            <div className='Box'>
                <div className='tableBox'>
                    <table>
                        <thead>
                            <tr>
                                <th>Uzbekistan</th>
                                <th>Germaniya</th>
                                <th>Xitoy</th>
                            </tr>
                            <tr>
                                <th>GM</th>
                                <th>UzAutoMotars</th>
                                <th>BMW</th>
                                <th>MercedesBenz</th>
                                <th>Haval</th>
                                <th>Lifan</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                this.state.Cars.uzb.GM.map((item, index) => <>
                                    <tr>
                                        <td>{item.name}</td>
                                        <td>{item.price}</td>
                                    </tr>
                                    <tr>
                                        <td>{item.name}</td>
                                        <td>{item.price}</td>
                                    </tr>
                                </>)
                            }
                            
                            {
                                this.state.Cars.uzb.UzAutoMotars.map((item, index) => <>
                                    <tr>
                                        <td>{item.name}</td>
                                        <td>{item.price}</td>
                                    </tr>
                                </>)
                            }
                        </tbody>




                    </table>
                </div>
            </div>
        )
    }
}
